// REACT
import { useEffect } from 'react';

// COMPONENTS
import ProjectCard from "../../components/projectCard/ProjectCard";

function Home() {
    useEffect(() => {
        const fetchData = async () => {
            await fetch("https://firestore.googleapis.com/v1/projects/monportfolio-8dd08/databases/(default)/documents/works")
            .then( response => response.json())
        }
        console.log("fetchData", fetchData);
    }, [])

    return (
        <main>
            <section>
                <ProjectCard />
            </section>
        </main>
    )
}

export default Home;
